import * as React from "react";
import { useState } from "react";
import "./App.css";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Modal from "@mui/material/Modal";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import { withRouter } from "react-router";
import background from "./1.jpg";

const style = {
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  width: 400,
  height: 200,
  bgcolor: "background.paper",
  border: "2px solid #000",
  boxShadow: 24,
  p: 4,
};

function Signup(props) {
  const [first_name, setFirst_name] = useState("");
  const [last_name, setLast_name] = useState("");
  const [email, setEmail] = useState("");
  const [data, setData] = useState([]);
  const [role, setRole] = useState("");
  const [gender, setGender] = useState("");
  const [address, setAddress] = useState("");

  const [rating, setRating] = useState("");
  const [mob_no, setMob_no] = useState("");
  // const [password, setPassword] = useState("");
  const [price, setPrice] = useState("");
  const [data2, setData2] = useState({
    first_name: "",
    last_name: "",
    email: "",
    role: "",
    // password: "",
    mob_no: "",
    price: "",
    rating: "",
    address: "",
  });
  const [open, setOpen] = useState(false);

  const url = "http://localhost:3001/users";

  const handleClick2 = () => {
    fetch(url)
      .then((res) => res.json())
      .then((res) => {
        setData(res);
      });
  };

  const handleClick = () => {
    setData2({
      first_name: first_name,
      last_name: last_name,
      email: email,
      gender: gender,
      mob_no: mob_no,
      role: role,
      address: address,
      price: price,
      rating: rating,
    });
    fetch(url, {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: data2,
    }).then((res) => res.json());
    console.log(data2);
  };

  // const handleClick = () => {
  //   let n, m, p, r;

  //   n = name;
  //   m = mob_no;
  //   p = password;
  //   r = price;
  //   let Plumber = new Array([]);
  //   let Electrician = new Array([]);
  //   let Carpenters = new Array([]);

  //   if (n !== "" && m !== "" && p !== "" && r !== "") {
  //     if (role === "Plumber") {
  //       Plumber = JSON.parse(localStorage.getItem("Plumber"))
  //         ? JSON.parse(localStorage.getItem("Plumber"))
  //         : [];

  //       Plumber.push({
  //         name: n,
  //         mob_no: m,
  //         password: p,
  //         price: r,
  //       });
  //       localStorage.setItem("Plumber", JSON.stringify(Plumber));
  //     }

  //     if (role === "Electrician") {
  //       Electrician = JSON.parse(localStorage.getItem("Electrician"))
  //         ? JSON.parse(localStorage.getItem("Electrician"))
  //         : [];

  //       Electrician.push({
  //         name: n,
  //         mob_no: m,
  //         password: p,
  //         price: r,
  //       });
  //       localStorage.setItem("Electrician", JSON.stringify(Electrician));
  //     }

  //     if (role === "Carpenters") {
  //       Carpenters = JSON.parse(localStorage.getItem("Carpenters"))
  //         ? JSON.parse(localStorage.getItem("Carpenters"))
  //         : [];

  //       Carpenters.push({
  //         name: n,
  //         mob_no: m,
  //         password: p,
  //         price: r,
  //       });
  //       localStorage.setItem("Carpenters", JSON.stringify(Carpenters));
  //     }
  //   }
  //   if (n !== "" && m !== "" && p !== "" && r !== "" && role !== "") {
  //     setOpen(true);
  //     console.log(role.length);
  //     setTimeout(() => {
  //       props.history.push({
  //         pathname: "/userDetails",
  //         state: { role: role },
  //       });
  //     }, 2000);
  //   }
  // };

  return (
    <div>
      <form id="form" action="">
        <TextField
          id="outlined-required"
          required
          label="Frst Name"
          placeholder="Enter your first name here"
          value={first_name}
          onChange={(event) => setFirst_name(event.target.value)}
        />{" "}
        <br /> <br />
        <TextField
          id="outlined-required"
          required
          label="Last Name"
          placeholder="Enter your last name here"
          value={last_name}
          onChange={(event) => setLast_name(event.target.value)}
        />{" "}
        <br /> <br />
        <TextField
          id="outlined-required"
          required
          label="Email"
          placeholder="Enter your mail here"
          value={email}
          onChange={(event) => setEmail(event.target.value)}
        />
        <br /> <br />
        <TextField
          id="outlined-number"
          required
          autoComplete="username"
          label="Mobile Number"
          type="number"
          value={mob_no}
          onChange={(event) => setMob_no(event.target.value)}
        />{" "}
        <br /> <br />
        <TextField
          id="outlined-required"
          required
          label="Gender"
          placeholder="Enter your gender here"
          value={gender}
          onChange={(event) => setGender(event.target.value)}
        />{" "}
        <br /> <br />
        <TextField
          id="outlined-required"
          required
          label="address"
          placeholder="Enter your address here"
          value={address}
          onChange={(event) => setAddress(event.target.value)}
        />
        <br /> <br />
        <Box sx={{ maxWidth: 235, marginLeft: 101 }}>
          <FormControl fullWidth>
            <InputLabel id="demo-simple-select-label">roles</InputLabel>
            <Select
              labelId="demo-simple-select-label"
              id="demo-simple-select"
              value={role}
              label="role"
              onChange={(event) => setRole(event.target.value)}
              required
              autoComplete="role"
            >
              <MenuItem value={"Plumber"}>Plumber</MenuItem>
              <MenuItem value={"Electrician"}>Electrician</MenuItem>
              <MenuItem value={"Carpenters"}>Carpenters</MenuItem>
            </Select>
          </FormControl>
        </Box>{" "}
        <br />
        <TextField
          id="outlined-number"
          autoComplete="price"
          label="Price"
          type="number"
          required
          value={price}
          onChange={(event) => setPrice(event.target.value)}
        />{" "}
        <br /> <br />
        <TextField
          id="outlined-number"
          autoComplete="rating"
          label="rating"
          type="number"
          required
          value={rating}
          onChange={(event) => setRating(event.target.value)}
        />
        <br /> <br />
        {/* <TextField
          id="outlined-password-input"
          label="Password"
          type="password"
          required
          autoComplete="current-password"
          value={password}
          onChange={(event) => setPassword(event.target.value)}
        />{" "} */}
        <br /> <br />
        <Button
          onClick={handleClick}
          style={{ marginRight: "20px" }}
          variant="outlined"
        >
          Sign Up
        </Button>
        <Button
          onClick={() => props.history.push("/dashboard")}
          variant="outlined"
        >
          Dashboard
        </Button>
      </form>
      <Modal
        open={open}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
          <Typography id="modal-modal-title" variant="h5" component="h1">
            Sign Up Successfully
          </Typography>
          <Typography
            id="modal-modal-title"
            variant="h6"
            sx={{ mt: 2 }}
            component="h2"
          >
            Name : {first_name}
          </Typography>
          <Typography id="modal-modal-description">
            mob_no Number : {mob_no} <br /> role : {role} <br /> Price : {price}{" "}
            Rs/-
          </Typography>
        </Box>
      </Modal>
      <Button
        onClick={handleClick2}
        style={{ marginRight: "20px" }}
        variant="outlined"
      >
        data
      </Button>
      {data.length !== 0 &&
        data.users.map((item, index) => {
          return (
            <h1 style={{ color: "red" }} key={index}>
              {item.email} {item.first_name} {item.last_name}
            </h1>
          );
        })}
    </div>
  );
}

export default withRouter(Signup);
